import '../css/resume.css';

function Resume(props) {
    return (
        <main className = "resume">
            <section> 
                <h1>Dedicated, Oriented and Precise</h1>
                <p></p>
            </section>
            <section> 
                <h1>Employment History</h1>
                {props.prevJobs.map(item => {
                    if(item.contract === true)
                    {
                        <div key={item.id}>
                            <h3> {item.title}</h3>
                            <p>Company: {item.company} - Contracted Through {item.contractCompany}</p>
                            <p>Employment Dates: {item.dateStart} to {item.dateFinish}</p>
                            <p> {item.description} </p>
                        </div>
                    }else{
                        <div key={item.id}>
                            <h3> {item.title}</h3>
                            <p>Company: {item.company}</p>
                            <p>Employment Dates: {item.dateStart} to {item.dateFinish}</p>
                            <p> {item.description} </p>
                        </div>
                    }
                })};
            </section>
            <section>
                <h1>Schooling</h1>
                {props.prevSchool.map(item => {
                    <div key={item.id}>
                        <h3>{item.name}</h3>
                        <p>Degree: {item.degree} </p>
                        <p>Enrollment Dates: {item.dateStart} to {item.dateFinish}</p>
                    </div>
                })}
            </section>
            <section>
                <h1>Skills</h1>
                {props.skills.map(item => {
                    <li className="list-group-item" key={item.id}>
                    {item.name}
                  </li>
                })};
            </section>
        </main>
    )
}

export default Resume;
